import React from 'react';

export default function Detail() {
    const [state, setstate] = React.useState(initialState);
    React.useEffect(() => {
        fetch('https://picsum.photos/id/237/200/300')
            .then((res) => res.json())
            .then((json) => {
                setstate(json);
            });
    }, []);
    return <></>;
}
